    data: |
      SELECT col1 - col1 AS col2 FROM tab0 (FORMAT parquet) AS cor0 WHERE ( NOT 7 * - col2 + col2 + - + col0 IN ( col1 * + col2 + - 73, col2 ) );
  - name: tab0

outputs:
  - name: q3824.out
    data: |
      0
      0
      0
